const React=require("react");

function Article(props){
return(
<div>
    <div className="article">
    <img src={props.picture} alt="avatar_img"/>
        <h4>{props.heading}</h4>
        <h2>{props.title}</h2>
        <p>{props.text}</p>
        <h3>{props.name}</h3>
    </div>
</div>);
}

export default Article;
